import React from 'react';
import ReactDOM from 'react-dom/client';
import Items from './LogItems/logitem';
const Logs = () => {
    const date1 = new Date('2022/11/2'); // 示例日期
    const date2 = new Date('2023/10/10') // 示例日期
    const date3 = new Date("2024/2/11"); // 示例日期
    const results = [{date: date1, name: '学习JavaScript', time: '60'},
                    {date: date2, name: '学习CSS', time: '40'},
                    {date: date3, name: '学习HTML', time: '30'}
                ]
                    ;
    return (
        <div className="logs">
            {results.map((item, index) => <Items key={index} date={item.date} name={item.name} time={item.time} />
            )};
        </div>
    );
}
export default Logs;
